import React from "react";
import SearchPopup from "./SearchPopup";
import SearchList from "./SearchList";

function SearchItem() {
  return (
    <div
      style={{
        display: "flex",
        flexDirecter: "row",
        width: "80%",
        margin: "10px auto",
      }}
    >
      <SearchPopup />

      <div>
        <SearchList />
      </div>
    </div>
  );
}
export default SearchItem;
